import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';
import reportWebVitals from './reportWebVitals';

class Car {
  constructor(name,year){
    this.brand = name;
    this.years = year;
  }

  shows(){
    return <p className=' bg-red-700 text-white font-bold'>The name of my car is {this.brand} {this.years}</p>

  }
}

const MyCar = new Car('Ford',1980);

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
    MyCar.shows()
);

